import React, { Component } from "react";

import SignIn from "./SignIn";
import SignUp from "./SignUp";

class FormHandler extends Component {
  state = {};
  render() {
    return (
      <div>
        <card no-body>
          <tabs pills card>
            <tab title="Sign-up" active>
            </tab>
            <tab title="Login">
            </tab>
          </tabs>
        </card>
        <SignUp />
        <br />
        <SignIn />
      </div>
    );
  }
}

export default FormHandler;
